import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';
import { ClaimLetterComponent } from '../claim-letter/claim-letter.component';
import { CreateNewLetterComponent } from '../claim-letter/create-new-letter/create-new-letter.component';
import { ChecklistItemComponent } from '../claim-letter/checklist-item/checklist-item.component';
import { SubmitLetterStatusComponent } from '../claim-letter/submit-letter-status/submit-letter-status.component';


const deductionRoutes: Routes = [
  {
    path: 'claim-letter',
    component: ClaimLetterComponent,
    data: {
      pageTitle: 'nspay2App.claim.claim-letter.home.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'create-new-letter',
    component: CreateNewLetterComponent,
    data: {
      pageTitle: 'nspay2App.claim.create-new-letter.home.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'checklist-item',
    component: ChecklistItemComponent,
    data: {
      pageTitle: 'nspay2App.claim.checklist-item.home.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'submit-letter-status',
    component: SubmitLetterStatusComponent,
    data: {
      pageTitle: 'nspay2App.claim.submit-letter-status.home.title'
    },
    canActivate: [UserRouteAccessService]
  },
];

@NgModule({
  imports: [RouterModule.forChild(deductionRoutes)],
  exports: [RouterModule]
})

export class PopUpRoutingModule { }
